export default function Sobre() {
  return (
      <div>
      <h1>Este projeto foi criado por Bruno Machado e Plinio Gonçalves</h1>
      <h2>O objetivo do projeto era realizar um clone do Airbnb, uma uma empresa americana que opera um mercado online de hospedagem, principalmente casas de família para aluguel por temporada e atividades de turismo. </h2>
      </div>
  );
}
